package main

import (
	"fmt"
	"sort"
)

func threeSum(nums []int) [][]int {
	var matches [][]int
	unique := make(map[[3]int]bool)
	numCounts := make(map[int]int)
	var numsLimited []int

	for _, v := range nums {
		c := numCounts[v]
		if c < 3 {
			numCounts[v] = c + 1
			numsLimited = append(numsLimited, v)
		}
	}

	for i, primary := range numsLimited {
		sub := twoSum(numsLimited[i+1:], -primary)

		for _, m := range sub {
			m = append(m, primary)
			sort.Ints(m)
			var check [3]int
			copy(check[:], m)
			if _, exists := unique[check]; !exists {
				matches = append(matches, m)
				unique[check] = true
			}
		}
	}

	return matches
}

func twoSum(nums []int, target int) [][]int {
	var matches [][]int
	m := make(map[int]int)
	for i, v := range nums {
		diff := target - v

		match, ok := m[diff]
		if ok {
			matches = append(matches, []int{nums[match], v})
		}

		m[v] = i
	}

	return matches
}

